function checkRedirectingDomain() {
    debugger;
    var referrer = "";
    if (document.referrer.length > 0) {
        ref = document.referrer.split('/');
        referrer = ref[2];

        if (validDomains.indexOf(referrer) > -1) {
            var domainStored = localStorage.getItem("domain");
            if (referrer != domainStored)
                return true;
        } 
    }
    return false;
}


